/* Function  structure for function  `getChildLst` */

/*!50003 DROP FUNCTION IF EXISTS `getChildLst` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getChildLst`(rootId VARCHAR(1000)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
       DECLARE sTempChd VARCHAR(1000);
    
       SET sTemp = '$';
       SET sTempChd = rootId;
    
       WHILE sTempChd IS NOT NULL DO
         SET sTemp = CONCAT(sTemp,',',sTempChd);
         SELECT GROUP_CONCAT(t.purchaser_code) INTO sTempChd FROM t_purchaser t WHERE FIND_IN_SET(t.sponsor_code,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `copyTableHis` */

/*!50003 DROP PROCEDURE IF EXISTS  `copyTableHis` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `copyTableHis`(IN countDate VARCHAR(20))
BEGIN
    
        DECLARE sCountDate VARCHAR(20);
        
        /*事务开始*/
        DECLARE t_error INTEGER DEFAULT 0;  
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;  
  
        START TRANSACTION;  
        
		/*业绩表的删除与复制*/
		DELETE FROM t_achieve_his WHERE  achieve_date = countDate;
		
		INSERT INTO t_achieve_his
		    (achieve_date,
		     PPV,
		     DBV,
		     IBV,
		     ATNPV,
		     TNPV,
		     GPV,
		     APPV,
		     purchaser_code,
		     rank_code)
		SELECT
		  achieve_date,
		  PPV,
		  DBV,
		  IBV,
		  ATNPV,
		  TNPV,
		  GPV,
		  APPV,
		  purchaser_code,
		  rank_code
		FROM t_achieve
		WHERE achieve_date = countDate;
		
		/*奖金表的删除与复制*/
		delete from t_bouns_his	where bouns_date = countDate;
		
		INSERT INTO t_bouns_his
		    (bouns_date,
		     direct_bouns,
		     indirect_bouns,
		     leader_bouns,
		     rank_code,
		     purchaser_code)
		SELECT
		  bouns_date,
		  direct_bouns,
		  indirect_bouns,
		  leader_bouns,
		  rank_code,
		  purchaser_code
		FROM t_bouns
		WHERE bouns_date = countDate;
		
	/*事务结束*/
	IF t_error = 1 THEN  
            ROLLBACK;  
        ELSE  
            COMMIT;  
        END IF;  
    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createChildLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `createChildLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createChildLst`(IN rootId varchar(6),IN nDepth INT)
BEGIN
      DECLARE done INT DEFAULT 0;
      DECLARE b varchar(6);
      DECLARE cur1 CURSOR FOR SELECT t.purchaser_code FROM t_purchaser t where t.sponsor_code=rootId;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    
      insert into tmpLst values (null,rootId,nDepth);
      OPEN cur1;
 
      
      FETCH cur1 INTO b;
      
     
      WHILE done=0 DO
              CALL createChildLst(b,nDepth+1);
              FETCH cur1 INTO b;
      END WHILE;
    
      CLOSE cur1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `showChildLst` */

/*!50003 DROP PROCEDURE IF EXISTS  `showChildLst` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `showChildLst`(IN rootId varchar(6))
BEGIN
      SET max_sp_recursion_depth=255;
     
      CREATE TEMPORARY TABLE IF NOT EXISTS tmpLst 
       (sno int primary key auto_increment,id varchar(6),depth int);
      DELETE FROM tmpLst;
    
      CALL createChildLst(rootId,0);
    
      select t_purchaser.* from tmpLst,t_purchaser where tmpLst.id=t_purchaser.purchaser_code order by tmpLst.sno;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `showTreeNodes` */

/*!50003 DROP PROCEDURE IF EXISTS  `showTreeNodes` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `showTreeNodes`(IN rootid varchar(6))
BEGIN
	DECLARE Level int ;
	/*
	 drop TABLE IF EXISTS tmpLst;
	 CREATE TABLE tmpLst (
	  ID varchar(6),
	  nLevel int,
	  sCort text
	 );*/
	 truncate table tmpLst;
	 
	 Set Level=1 ;
	 INSERT into tmpLst SELECT t_purchaser.purchaser_code,Level,t_purchaser.purchaser_code FROM t_purchaser WHERE t_purchaser.sponsor_code=rootid;
	 WHILE ROW_COUNT()>0 DO
	  SET Level=Level+1 ;
	  INSERT into tmpLst 
	   SELECT A.purchaser_code,Level,concat(B.sCort,A.purchaser_code) FROM t_purchaser A,tmpLst B 
	    WHERE  A.sponsor_code=B.ID AND B.nLevel=Level-1  ;
	 END WHILE;
    END */$$
DELIMITER ;

